const Persons = (props) => {
  return (
    props.persons.map(person =>
      <form onSubmit={props.removePerson}>
      <div key={person.name}>
        {person.name} {person.number} 
      <button type="submit">delete</button>
      </div>
      </form>
      )
  )
}

export default Persons
